<html>
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <title></title>
        <meta name="description" content="">
        <meta name="viewport" content="width=device-width, initial-scale=1">

    <body>
            <h1>Users List</h1>
            <table>
                <thead>
                    <tr>
                        <th>User ID</th>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Access Level</th>
                        <th>Email</th>
                    </tr>
                </thead>
                <tbody>
                    {% for user in users %}
                    <tr>
                        <td>{{ user['user_id'] }}</td>
                        <td>{{ user['f_name'] }}</td>
                        <td>{{ user['s_name'] }}</td>
                        <td>{{ user['email'] }}</td>
                    </tr>
                    {% endfor %}
                </tbody>
            </table>
        
        
        <script src="" async defer></script>
    </body>
</html>
